export const state = () => ({
    ...initialState
})

export const getters = {
    
    currentListByShip: (state) => (shipId) => {
        
        return state.unlocks.filter(unlock => unlock.shipId === shipId)
    },

    currentByShipCount: (state) => (shipId, shipCount) => {
        
        let result = null
        
        let unlocks = state.unlocks.filter(unlock => unlock.shipId === shipId )
        if (unlocks) {
            for (let i = 0; i < unlocks.length; i++) {
                
                let temp = unlocks[i]
                if (shipCount < temp.threshold) {
                    result = temp
                    break
                }
            }
        }
        
        return result
    },

    notReachedByShipCount: (state) => (shipId, shipCount) => {
        
        return state.unlocks.filter(unlock => (unlock.shipId === shipId) && (unlock.threshold <= shipCount) && (unlock.reached == false))
    },
}

export const mutations = {
    
    setReached(state, payload) {
        
        let unlock = state.unlocks.find(unlock => unlock.id === payload.unlockId)
        unlock.reached = payload.value
    },
}